import "./ContentList.css";

function ContentList({ content, onChangeSelectedContent }) {
  return (
    <div className="ContentList">
      <div className="content__item">
        <li className="contents__list" key={content.id}>
          <div className="username">{content.username}</div>
          <div
            className="title"
            onClick={onChangeSelectedContent(content.title)}
          >
            {content.title}
          </div>
          <div className="createAt">{content.createdAt}</div>
        </li>
      </div>
    </div>
  );
}

export default ContentList;
